import React from 'react';

export default function Header() {
    return (
        <div className="header">
            <img src="./img/GitHub-Mark-32px.png" alt=""/>
            <input type="text" name="search" id="search"/>
            <span className="header-navtxt">Pull requests</span>
            <span className="header-navtxt">Issues</span>
            <span className="header-navtxt">Marketplace</span>
            <span className="header-navtxt">Explore</span>  
        </div>
    )
}
